def generate_readme(author, author_email, license, url, description, long_description, classifiers):
    readme_content = f'# Package Name

{description}

## Installation

Use the package manager [pip]({url}{license}]({url})

## Author
{author}
{author_email}

## Development Status
{classifiers[0]}

## Classifiers
'
    for classifier in classifiers:
        readme_content += f'- {classifier}
'
    return readme_content
